import React, { Component } from "react";
import PostData from "./bio.json";
class App extends Component {
  constructor() {
    super();
    this.state = {
      questionNum: 0,
    };
  }

  render() {
    return (
      <>
        <center>
          <div>
            {/* {PostData.map((postDetail, index) => {
              return <p>{postDetail.title}</p>;
            })}  */}
            <p>{PostData[this.state.questionNum].title}</p>
            <p>
              {PostData[this.state.questionNum].choices.map((choice, index) => {
                return <p>{choice}</p>;
              })}
            </p>
          </div>
          <button onClick="">Next</button>
        </center>
      </>
    );
  }
}

export default App;
